class Solution {

    /**
     * @param String $s
     * @param Integer $k
     * @return Integer
     */
    function beautifulSubstrings($s, $k) {
        $beautifulCount = 0;
        $length = strlen($s);

        for ($start = 0; $start < $length; $start++) {
            $vowels = 0;
            $consonants = 0;
            for ($end = $start; $end < $length; $end++) {
                if (in_array($s[$end], ['a', 'e', 'i', 'o', 'u'])) {
                    $vowels++;
                } else {
                    $consonants++;
                }

                if ($vowels == $consonants && ($vowels * $consonants) % $k == 0) {
                    $beautifulCount++;
                }
            }
        }

        return $beautifulCount;
    }
}
